         booksMapped = booksFromSearch.map(book=>{

            return(
                <BookCard book ={book}/>
            )
        })
    }

    return (
        <div className="book-index">
            book index
            {/* <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike"/> */}

            {booksMapped}  
